      LitanyContent(id: 368, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "Miaso 80:19", content: "Mwene Zambi, Zambi Mukwa Ndundo Jeswe, tupwise kama ngwe chize twabwile hatangu! Tuvwile kama keke, utulamwine"),
      LitanyContent(id: 369, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "Miaso 80:8-9", content: "Hiunachiza mutondo wa vinyu mu Egiptu, hiunahunu atu akwo mu chifuchi cho, hiunatumbu mo we mutondo uze. Hiunalulika homa habema hanga utatuke; miji yawo hiyinayi Kusuku, hiyinatande mu chifuchi cheswe"),
