      LitanyContent(id: 371, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "Miaso 80:14-15", content: "Zambi, Mukwa Ndundo Jeswe, tewuluka kama kuli yetu! Kuze kwilu watwama tutale kama, tweya ulamwine kama atu je! Tweya ulamwine kama mutondo Wa vinyu uze watumbile yena mwene, chibuta cha ndenda chize watatwishile"),
      LitanyContent(id: 372, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "", content: "Mwene Zambi, Zambi Mukwa Ndundo Jeswe, tupwise kama ngwe chize twabwile hatangu! Tuvwile kama keke utulamwine"),
      LitanyContent(id: 373, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "Miaso 51:1,10", content: "Aa Zambi, nguvwile kama keke, mumu ha zango lie lize kulishi kukwa. Jimuna kama milonga yami, mumu ha keke ye yinji. Aa Zambi, ngwehe kama mbunge yibema, mbunge yaha, yize yamwenemwene"),
      LitanyContent(id: 374, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "", content: "Mwene Zambi, Zambi Mukwa Ndundo Jeswe, tupwise kama ngwe chize twabwile hatangu! Tuvwile kama keke utulamwine"),
      LitanyContent(id: 375, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "Miaso 51:2, 4, 15, 12, 17b", content: "Ngusanyise liakulu ku uhenga wami, ngubemese kama ku shili yami! Yena nakuvulumwine, yena wika, nalingile yuma yize wakubihilila. Kashika yena unasambe ha kungubatwila, unalingi ni ululi ha kunguhisa. Mwene Zambi, ngukwase kama ha hanjika, mba mungukuhalise. Ngwehe kama nawa uwahililo wa ulamwino we, ngukolese, kulikehesa ni ya chinyengo"),
      LitanyContent(id: 376, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "", content: "Mwene Zambi, Zambi Mukwa Ndundo Jeswe, tupwise kama ngwe chize twabwile hatangu! Tuvwile kama keke utulamwine"),
      LitanyContent(id: 377, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "Vilinga 11:17-18", content: "Nyi Zambi hamaahe chawana chimuwika ngwe chize atuhele yetu muze twafulielele Mwene Yesu Kristu, mba yami nguli iya te munguhasa kukinda Zambi? Chamwenemwene Zambi hahana nawa kuli waze hi Ayuda ko kwalumuka cha mbunge hanga abwe ni mwono"),
      LitanyContent(id: 378, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "", content: "Mwene Zambi, Zambi Mukwa Ndundo Jeswe, tupwise kama ngwe chize twabwile hatangu! Tuvwile kama keke utulamwine"),
      LitanyContent(id: 379, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "Vilinga 11:12ª,15; Roma 8:14", content: "Mwiku wa Linanga yiungwamba hanga nguye no, kuyambashana ka. Shimbu lize nabutukile kuhanjika, Mwiku Wa Linanga yiwahulumukina, ngwe chize Watuhulumukinyine yetu hatangu. Eswe Waze Mwiku Wa Zambi Wakusongwela, enoo e ana ja Zambi"),
      LitanyContent(id: 380, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "", content: "Mwene Zambi, Zambi Mukwa Ndundo Jeswe, tupwise kama ngwe chize twabwile hatangu! Tuvwile kama keke utulamwine"),
      LitanyContent(id: 381, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "Vilinga 12:7-8", content: "Susumuku kanganda ka mwuilu yasoloka, pangu yilipanguka mu zuwo lia lamba. Kanganda yamwamba ngwenyi: Lijichike muya we ni sapato je. Zala chikuto che, ungukaule"),
      LitanyContent(id: 382, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "", content: "Mwene Zambi, Zambi Mukwa Ndundo Jeswe, tupwise kama ngwe chize twabwile hatangu! Tuvwile kama keke utulamwine"),
      LitanyContent(id: 383, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "2 Pet.3:13, Usol. 21:3-4", content: "Alioze Zambi hamalakenya lilu liaha ni así haha haze muhakabwa ululi. Yingwivwa liji linene ku chitwamo cha Wanangana ngwo: Haliabwila Zambi kakutwama mukachi ka atu! Makatwama hamwe no, no maakabwa atu jenyi, Zambi iye mwene makabwa hamwe no, makabwa Zambi yo. Makakusumuna masoji eswe ku meso jo. Kufwa kuchichi kabwa nwa. Yuma yitangu hiyinahu"),
      LitanyContent(id: 384, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KULIKONYEKENA, books: "", content: "Mwene Zambi, Zambi Mukwa Ndundo Jeswe, tupwise kama ngwe chize twabwile hatangu! Tuvwile kama keke utulamwine"),

      LitanyContent(id: 385, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "Izaya 55:6-7", content: "Fupenu Mwene Zambi ha shimbu lize munuhasa kumunona, mutambikenu shimbu uchili hehi. Yingulungulu ehuke ndako jo jibi, alumune mbunge jo. Atewulukile kuli Mwene Zambi, Zambi yetu; mumu kali mukwa keke, kakukonekena nikawashi"),
      LitanyContent(id: 386, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "Miaso 100:5", content: "Mwene Zambi kali mubema, zango lienyi kulishi kuhwa; umwenemwene wenyi wakulinduluka ndoo ku miaka yeswe"),
      LitanyContent(id: 387, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "Izaya 1:18; 1 Yoano 1:7", content: "Chibwe milonga yenu yachila naye ngee, kumuyibwa yitoma ngwe chiwe; chibwe yibeka yenu ya mu mbunge yahiana naye kuchila, kumuyibwa yitoma ngwe Wanda. Alioze, nyi tuli mu pangu ngwe Chize Zambi iye mwene kali mu pangu, ni manyinga a Yesu Mwanenyi,  kaakutubemesa ku shili yeswe"),
      LitanyContent(id: 388, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "1 Yoano 1:8-9", content: "Nyi twakwamba ngwetu, kutushi shili, twakulionga yetwene, ni umwenemwene kuushimo muli yetu. Alioze, nyi twakushikisa milonga yetu, iye kali mukwa kushishika ni mukwa ululi ha kutukonekena milonga yetu, ni kubemesa ku uhenge Weswe"),
      LitanyContent(id: 389, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "Yishima 28:13, Miaso 32:1", content: "Nyi wasweka milonga ye, kuuchi kawaha nichimwe; alioze nyi muyishikisa ni kuyehuka, mba Zambi makuvwila keke. Kawaha Waze Zambi hanaakonekena shili yo, Waze Hanaajimuna milonga yo"),
      LitanyContent(id: 390, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "Miaso 32:5", content: "Mba yingushikisa shili yami kuli yena; chakuswekelele ko uhenge wami. Nabatwile ngwami, munguyishikisa kuli yena, ni yena yiungukonekene yo yeswe"),
      LitanyContent(id: 391, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "Jeremia 29:11-13; Lung. 3:40,41", content: "Yami mwene ngunanyingika yize ngunanunyongena, manyonga a kunuyukisa, hi a kunumwesa lamba ko, akunuyukisa yuma yize nunase mbunge. Hohene munukangutambika, munukeza ni kulemba kuli yami, mba yami mungukanukumbulula. Munukangufupa ni kunguwana, munu munukangufupa ni mbunge jenu jeswe. Tuhengulenu majila jetu, tuhilukenu kuli Mwene Zambi. Tuhanenu mbunge jetu kuli Zambi mwilu ni kulemba ngwetu"),
      LitanyContent(id: 392, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "Miaso 51:1,10, 139.24", content: "Aa Zambi, nguvwile kama keke, mumu ha zango lie lize kulishi kuhwa. Jimuna kama milonga yami, mumu ha keke ye yingi. Aa Zambi, ngwehe kama mbunge yibema, mbunge yaha, yize yamwenemwene. Umone nyi ku muli chimwe chibi, ngusongwele mu jila yibema ya miaka yeswe"),
      LitanyContent(id: 393, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "2 Kor. 5:21; Rom. 6:11", content: "Kristu kabwile ko ni shili, alioze Zambi yamwaha yilemu ya shili yetu, hanga Zambi atupwise akwa ululi ha kulinungani Kristu. Ni yenu nawa chizechene, chatamba kulinyonga ngwenu, nuli afu hakutwala ku shili, alioze nuli a mwono hakutwala kuli Zambi ha kulinunga ni Yesu Kristu"),
      LitanyContent(id: 394, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "Efs 1:7", content: "Ku manyinga ja Kristu hanatukula, kafwa hanatukonekena milonga yetu nikulita ni utu wenyi wahiana"),
      LitanyContent(id: 395, person: LitanyPerson.DIRECTOR_CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_KWITA_CHECA_NI_CHECA, books: "2 Kor. 9:15", content: "Tu sakwilenu Zambi mumu ha chawana chenyi chahiana"),

      LitanyContent(id: 396, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twahana uwahililo hali Zambi ha umwenemwene wenyi hali yetu malunga ha yuma ingi ya kuhanjika nyi yakulinga chahiana chikolo ha kuhanjika ha li Mwanenyi Yesu Kristu, Chilamwina Chetu, walingiwile jila yetu, umwenemwene wetu ni mwono wetu"),
      LitanyContent(id: 397, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twawahilila kuli Zambi ha umwenemwene wenyi wahiana"),
      LitanyContent(id: 398, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twahana uwalilo hali Zambi jetu, Spiritu Santu ni milimo ya ulamwinoyize Spiritu Santu ha  na manununa hali yetu ha mana ni tachi jize a ku twaha"),
      LitanyContent(id: 399, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twawahilila kuli Zambi ha umwenemwene wenyi wahiana"),
      LitanyContent(id: 400, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twahana uwahililo ha Zambi ha ulumbunwishi waku soneka, yize alingile yitemo ya kuyiliato yetu nawa mu yitusongwela mu jila ya ulamwino ni mwono wa mutolo. Twa mwaha nawa uwahililo ha ku tutuma waze atwambulwile liji lienyi likolo ni ku tulweza ulamwino wa  mwene"),
      LitanyContent(id: 401, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twawahilila kuli Zambi ha umwenemwene wenyi wahiana"),
      LitanyContent(id: 402, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twahana uwahililo kuli Zambi ha ku tusanyika ni ku wana milimo yenyiyikolo ni mukwa  kwambonjola. Twa mwaha nawa uwahililo munu tunayingika ngwetu ha milimoyino tuna  kwasa mbunga ya Chifuchi chetu, ni ku hana umwenemwene ngwo wanangana wa matembele muli yetu ufumane"),
      LitanyContent(id: 403, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twawahilila kuli Zambi ha umwenemwene wenyi wahiana"),
      LitanyContent(id: 404, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twahana uwahililo kuli Zambi mumu katuhichikileko nyi yikakashana, mba ya twaha  umwenemwene wa ku tumina uze Mwene wetu Yesu Kristu, nyi kwamba: «yenu mu yifuchi  yeswe ni hanenu sango hali atu eswe», mba iye mwene lume yatu lakenya ni kujikiza muze ambile: «Hali yenu ami nguli ni yehu matangwa eswe, ndo hakuhwisa cha miaka»"),
      LitanyContent(id: 405, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.KWITA_CHA_YILINGA_YA_KUSAKWILILA, books: "", content: "Twawahilila kuli Zambi ha umwenemwene wenyi wahiana"),

      LitanyContent(id: 406, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "", content: "Yimbilenu mwene wa ene, yoze atumine ni wejile mukulamwina Waza hanatayiza kulinga  upale Wa mwene"),
      LitanyContent(id: 407, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "", content: "Mavungu eswe amuchichimieke ngwo, Aleluya kuli Muata wa Sambukila!"),
      LitanyContent(id: 408, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "Luka 1:32-33", content: "Makabwa mwanangana munene, atu maakanuvuluka ngwo: “Mwana wa mukwa Mwilu  mwahiana? Mwene Zambi makamwaha citwamo cha kashakulu kenyi David. Makayula vungu  lia Yakoba ku miaka yeswe. Wanangana Wenyi kuuchi kahwa"),
      LitanyContent(id: 409, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "", content: "Mavungu eswe amuchichimieke ngwo, Aleluya kuli Muata wa Sambukila!"),
      LitanyContent(id: 410, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "Luka 1:37, 45, 48-50", content: "Mumu Zambi nichimwe machisa kenu. Kuwawaha yena wafulielele ngwe, yize akulwezele Mwene muyikamanunuka! Mumu hatala ulelu wami, yami ndungo yenyi. Chize ku haliabwila yisemuko yeswe maakanguvuluka ngwo, kawaha, mumu Zambi, Mukwa Ndundo yeswe,  hangulingila yuma yinene. Jina lienyi lia linanga. Kakuvwila keke waza akumuvwila woma ku yisemuko yeswe"),
      LitanyContent(id: 411, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "", content: "Mavungu eswe amuchichimieke ngwo, Aleluya kuli Muata wa Sambukila!"),
      LitanyContent(id: 412, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "Hebreu 1:5-6,8; Izaya 9:6", content: "Mumu Zambi kanda ambila kama umwe kanganda ka mwilu ngwenyi: “Yena uli Mwanami  Hinakusema musono uno”. Chibwe kanda ambila kama umwe kanganda kamwilu ngwenyi: “Mungukabwa Tato, neye makabwa Mwanani. “Alioze hakutwala kuli Muanenyi Zambi hanambe ngwenyi: “Zambi, chitwamo che cha Wanangana muchilinduluka ku miaka yeswe  ni miaka yeswe! Wakungula Wanangana we ni ululi. Kuli yetu hikwasemuka mwana! Mwana lunga hatwala yo. Kumakabwa mukwa kutuyula. Kumaakamuvuluka ngwo: “Mukwa Kukomwesa, mukwa Kukanyamisa, Zambi mukwa Ndundo, Tata wa Miaka Yeswe,  Muannangana Wa Uhwimino"),
      LitanyContent(id: 413, person: LitanyPerson.CONGREGATION, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "", content: "Mavungu eswe amuchichimieke ngwo, Aleluya kuli Muata wa Sambukila!"),
      LitanyContent(id: 414, person: LitanyPerson.DIRECTOR, litanyTitle: CoLitanyTitleSeeder.LIA_NATALE, books: "Miaso 18:49;67:5; Rom 14:11; Usol 7:9-10", content: "Kashika nakukuchichimieka hakachi ka mavungu, nakukwimbila uhaliso. Aa Zambi, mavungu eswe akuhalise! Munu hichinasonewa mu Mukanda wa Zambi ngwo: Chamwenemwene ni  we mwono wami, eswe maakafukama ku meso jami. Eswe maakatayiza ngwo: “Yena uli Zambi,” Chenacho anambe Mwene Zambi. Munabwamuze yingutala nawa, mba yingumona  mbunga ya atu anji. Atu a ku vungu lieswe ni a kuli atu eswe, ni a ku maliji eswe. Yaakololoka ngwo: «Zambi yetu, yoze  watwama ha chitwamo cha wanangana, ni Mwana Panga, haanatulamwina"),
